import logo from './logo.svg';
import './App.css';
import { BrowserRouter as Router, Route } from "react-router-dom";
import Jouster from './components/Jouster/Jouster';
function App() {
  return (
    <Router>  
      <Routes>
        <Route path="/jousting" exact render={(props) => (
                <>
                    {<Jouster/>}
                </>
            )}
        />
      </Routes>
    </Router>
  );
}

export default App;
